        article: sourceEntry,
        compare: compareEntry,
        versions: articleVersions[group][name]
      }; // add unique id
      // TODO: replace all group-name-version in template with id.

      fields.article.id = fields.article.group + '-' + fields.article.name + '-' + fields.article.version;
